import React from "react";
import AddMoviePage from "./pages/AddMoviePage";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { MovieListPage } from "./pages/MovieListPage";
import { UpdateMovieDetails } from "./pages/UpdateMovieDetails";
import MovieContextProvider from "./context/MovieContext";
import SignUpPage from "./pages/SignUpPage";
import UserRegPage from "./pages/UserLoginPage";
import UserContextProvider from "./context/UserContext";
function App() {
  return (
    <MovieContextProvider>
      <UserContextProvider>
        <div>
          <BrowserRouter>
            <Routes>
              <Route path="/" element={<SignUpPage />} />
              <Route path="/mov" element={<AddMoviePage />} />
              <Route exact path="/list" element={<MovieListPage />} />
              <Route exact path="/update" element={<UpdateMovieDetails />} />
              <Route exact path="/login" element={<UserLoginPage />} />
            </Routes>
          </BrowserRouter>
        </div>
      </UserContextProvider>
    </MovieContextProvider>
  );
}

export default App;
